# Function to remove duplicates based on 'name'
def remove_duplicates(json_data):
    for key, values in json_data.items():
        seen = set()
        unique_values = []
        for item in values:
            if item['name'] not in seen:
                unique_values.append(item)
                seen.add(item['name'])
        json_data[key] = unique_values
    return json_data

